              const info = constituencyData[c.code];
              const gainText = info && info.avg_gain ? `£${info.avg_gain.toFixed(2)} gain` : 'No data';
              return `<div class="search-result-item" data-code="${c.code}">${c.name} <small style="color:#319795">${gainText}</small></div>`;
            })
            .join('');
          searchResults.style.display = 'block';
        } else {
          searchResults.style.display = 'none';
        }
      });

      searchResults.addEventListener('click', (e) => {
        if (e.target.classList.contains('search-result-item')) {
          const code = e.target.dataset.code;
          const feature = geojson.features.find((f) => f.properties.GSScode === code);
          if (feature) {
            const bounds = path.bounds(feature);
            const dx = bounds[1][0] - bounds[0][0];
            const dy = bounds[1][1] - bounds[0][1];
            const x = (bounds[0][0] + bounds[1][0]) / 2;
            const y = (bounds[0][1] + bounds[1][1]) / 2;
            const scale = Math.min(8, 0.9 / Math.max(dx / w, dy / h));
            const translate = [w / 2 - scale * x, h / 2 - scale * y];

            svg
              .transition()
              .duration(750)
              .call(
                zoom.transform,
                d3.zoomIdentity.translate(translate[0], translate[1]).scale(scale)
              );

            searchResults.style.display = 'none';
            searchInput.value = '';
          }
        }
      });

      // Close search on click outside
      document.addEventListener('click', (e) => {
        if (!e.target.closest('.search-container')) {
          searchResults.style.display = 'none';
        }
      });
    </script>
  </body>
</html>
